import React from 'react';
import axios from "axios";
import '../App.css';

const checkIn = () => {
    return (
            <div class="checkin">
              <h2>Check In</h2>
              <form>
                <div class="textbox">
                  <label>
                    PID:
                  <input type="text" name="pid" />
                  </label>
                </div>
                <div class="textbox">
                  <label>
                    Reason:
                  <input type="text" name="reason" />
                  </label>
                </div>
                <input class="submit" type="submit" value="Submit" onClick={SubmitCheckIn()}/>
              </form>
            </div>
          );
}

function SubmitCheckIn(){
  const item = {
    name: "Anna",
